                // Theme keywords
                if (titleLower.includes('lake') || titleLower.includes('sea') || titleLower.includes('beach') || titleLower.includes('water') || titleLower.includes('ocean')) { t.add('Water'); t.add('Nature'); t.add('Landscape'); }
